function NotificationsmodalRow ({Src, title, PersonName, Note, Time}) {
    return (
        <div className= "items-center text-gray-500 hover:bg-white rounded-md cursor-pointer group">

        <div className="items-center space-x-2 mt-2 p-2">
            {Src && <img src= {Src} alt="dp" className= "inline-flex w-10 h-10 p-0.5 bg-white group-hover:bg-gray-600 cursor-pointer object-cover rounded-full "/>}
