               {title}</p>
            <p className= "sm:inline-flex text-sm font-light">
               {PersonName}</p> 
            <p className= "sm:inline-flex font-bold text-sm text-gray-500">
               {Time}</p>
        </div>
        <p className= "sm:inline-flex font-bold text-sm text-gray-500">
               {Note}</p>
        </div>

    )
}

